import React from 'react';
import './/LoginCard';

const LoginCard = () => {
    return (
        <div className="login-card">
            <form className="login-form">
                <div className="login-label-id">
                    <label htmlFor="id">ID :</label>
                </div>
                <br />
                <input className="login-input-id" type="text" id="id" />
                <br />
                <label htmlFor="pwd" className="login-label-pwd">
                    Mot de passe :
                </label>
                <br />
                <input className="login-input-pwd" type="text" id="pwd" />
            </form>
        </div>
    );
};

export default LoginCard;
